import { useState } from "react";
import "./App.css";

function App() {
  const [selectedDate, setSelectedDate] = useState(null);
  const [selectedModel, setSelectedModel] = useState(null);

  const handleDateClick = (date) => {
    setSelectedDate(date);
  };

  const handleModelClick = (model) => {
    setSelectedModel(model);
  };

  const dates = [
    { date: "15 Jul", day: "Sun" },
    { date: "16 Jul", day: "Mon" },
    { date: "17 Jul", day: "Tue" },
    { date: "18 Jul", day: "Wed" },
    { date: "20 Jul", day: "Thr" },
    { date: "21 Jul", day: "Fri" },
    { date: "22 Jul", day: "Sat" },
  ];

  const models = [
    // { name: 'Motion detection' },
    // { name: 'Humanoid detection' },
    // { name: 'Face detection' },
    // { name: 'Line crossing detection' },
    // { name: 'Area detection' },
    // { name: 'Unattended baggage detection' },
    // { name: 'Missing object detection' },
  ];
  return (
    <>
      {/* <div className="containear"> 
        <div>
          <h1>AI Events</h1>
          <h4>List of events triggered by cameras</h4>
        </div>
        <div>
          <div>
            <p>events </p>
            <p>notifications</p>
            <p>reports</p>
          </div>
          <div>
            <p>all device</p>
            <p>per</p>
            <p>next</p>
          </div>
        </div>
        <div>
          <p>dayes</p>
        </div>
        <div>
          main

        </div>
      </div> */}

      <div className="container">
        <div className="A">
          <div>
          <h1>Al Events</h1>
          <p>List of events triggered by cameras</p>
          </div>
          <div>
          <div className="header">
            {/* <div className="dropdown">
              <button className="dropdown-button">All Device</button>
              Add dropdown options here
            </div> */}
            <button className="header-button">Events</button>
            <button className="header-button">Notifications</button>
            <button className="header-button">Reports</button>
          </div>
          <div className="nav">
            <button className="dropdown-button">All Device</button>
            <button className="nav-button">previous week</button>
            <button className="nav-button">next week</button>
          </div>
          </div>
        </div>

        <div className="dates">
          {dates.map((date) => (
            <div
              key={date.date}
              className={`date-button ${
                selectedDate === date.date ? "selected" : ""
              }`}
              onClick={() => handleDateClick(date.date)}
            >
              <p>{date.date}</p>
              <p>{date.day}</p>
            </div>
          ))}
        </div>
        <div className="models">
          <div className="models-header">
            <input
              type="text"
              placeholder="All detection models"
              className="models-input"
              readOnly
            />
            <button className="models-clear">clear</button>
          </div>
          <div className="models-list">
            {models.map((model) => (
              <div
                key={model.name}
                className={`model-item ${
                  selectedModel === model.name ? "selected" : ""
                }`}
                onClick={() => handleModelClick(model.name)}
              >
                <p>{model.name}</p>
                {selectedModel === model.name && (
                  <div className="check-mark"></div>
                )}
              </div>
            ))}
          </div>
        </div>
        <div className="preview">{/* Add preview content here */}</div>
      </div>
    </>
  );
}

export default App;
